import React from 'react';

function Heading () {
    return (
        <>
            <Video></Video>
            <CalcBody>
                
            </CalcBody>
        </>
    )
}

function Video () {
    return (
        <>
        <video style={vid} autoPlay loop muted>
            <source src="video.mp4" type="video/mp4"></source>
        </video>
        </>
    )
}

function CalcBody () {
    return (
        <>
        <div className="blur">
            <Header></Header>
            <Inputs></Inputs>
            <div id="red"></div>
        </div>
        </>
    )
}

function Header () {
    return (
        <h1>Please input Numbers</h1>
    )
}

function Inputs () {
    return (
        <>
            <div>
                <input style={inp} type="text" />
                <input style={inp} type="teyt" />
            </div>

            <Buttoned></Buttoned>
            
        </>
    )
}

function Buttoned () {
 return (
    <button style={but}>Click</button>
 )
}

const a = document.querySelectorAll('input')[0].value;
const b = document.querySelectorAll('input')[1].value;

console.log(a, b);


function Outputs () {
    return (
        <>
        <p>{`Sum of the Two number is ${sum(a,b)}`}</p>
        <p>{`Differnece of the Two number is ${sub(a,b)}`}</p>
        <p>{`Product of the Two number is ${multiply(a,b)}`}</p>
        <p>{`Division of the Two number is ${divide(a,b)}`}</p>
        </>
    )
}

function sum (x, y) {
    return x + y;
}

function sub (x, y) {
    if (x>y) {
        return x - y;
    } else {
        return y - x;
    }
}

function multiply (x,y) {
   return x * y;
}

function divide (x, y) {
    if (x>y) {
        return x / y;
    } else {
        return y / x;
    }
}


const vid = {
    width : '100%',
    // height : '100vh',
    position : 'absolute',
    top : '0',
    left : '0',
    overflow : 'hidden',
    zIndex : '1'
}

const inp = {
    width: '70px',
    height : '30px',
    backgroundColor : 'white',
    border : 'none',
    margin : '20px',
    color : 'black',
}

const but = {
    width : '50px',
    height : '30px'
}

export default Heading;

export {Outputs};
